import React from "react";
import App from "./new";
function Ranges(){
    const getSelect = ()=>{
        var mylist = document.querySelector(".sel");
        return mylist.options[mylist.selectedIndex];
    }   
    return (<>
        <select className="sel" onChange = {(e)=> getSelect}>
            <option value="10000" >below 10,000</option>
            <option value="9999">below 20,000</option>
            <option value="20000">below 30,000</option>
            <option value="2999">below 3,000</option>
            <option value="0" selected="select" >ALL</option>
            </select>
    </>)
}
export default Ranges;
